Spin Doctors - Two Princes [promo].VOB



HQ promo music video. &quot;Two Princes&quot; is a song by the New York City-based 
alternative rock band Spin Doctors. As a single, it reached #7 in the U.S., 
#2 in Canada, and #3 in the UK. It was the band's most popular song.
